    # Mostra a animação em tela
    for i in range(len(animation)):
        # Função importada da lib time para que a animação não seja mostrada toda de uma vez
        sleep(intervalo)
        stdout.write("\r" + animation[i % len(animation)])
        stdout.flush()

    print("\n")


